package leetTasks._075_isSubsequence;

import java.util.Arrays;

public class Solutuon {

    public static void main(String[] args) {
        String s = "leeeeetcode";
        String t = "\"\"";
        System.out.println(isSubsequence(s, t));
    }

    public static boolean isSubsequence(String s, String t) {

        StringBuilder builderT = new StringBuilder(t);
        int[] indexes = new int[s.length()];
        for (int i = 0; i < s.length(); i++) {
            if (i == 0) {
                indexes[i] = builderT.indexOf(String.valueOf(s.charAt(i)));
            } else {
                indexes[i] = builderT.indexOf(String.valueOf(s.charAt(i)), indexes[i - 1]);
            }
            if (indexes[i] == -1) {
                return false;
            } else {
                // System.out.println(builderT.charAt(indexes[i]));
                builderT.deleteCharAt(indexes[i]);
                if (i > 0) {
                    if ((indexes[i] - indexes[i - 1]) < 0) {
                        return isSubsequence(s, builderT.toString());
                    }
                }
            }
        }
        return true;
    }
}
